    constructor(){
        super()

    }

    render(){
        const movie = this.props.movie
        return (
            <div>
                <h2>{Movie.title}</h2>
                <div>
                    <img
                    width="100"
                    height="100px"
                    alt={`The movie titled:${movie._title}`}
                    src={movie.movie_poster}
                    >

                    </img>
                </div>
                <p>{movie.Year}</p>
            </div>

        );
    }
}

export default Movie
